import './App.css';
import {
  MDBInputGroup,
  MDBBtn
} from 'mdb-react-ui-kit';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>To Do List App</h1>
      </header>
      <main>
        <form>

          <MDBInputGroup className='mb-3' textBefore='Default'>
            <input className='form-control' type='text' />
            <MDBBtn outline>Button</MDBBtn>
          </MDBInputGroup>
          <input type="text"/>
        </form>
      </main>
    </div>
  );
}

export default App;
